O Conselho Regional de Psicologia da 6ª Região - CRP06 é uma autarquia federal criada pela Lei nº 5.766, de 20 de dezembro de 1971, dotada de personalidade jurídica de direito público, razão pela qual possui atribuição de realizar processo licitatório destinado à contratação de bens, serviços e demais aquisições, em atendimento aos comandos do artigo 37 da Constituição da República.

O sucesso nas licitações e contratações públicas depende fundamentalmente da atuação dos gestores e fiscais de contratos. A gestão e fiscalização dos contratos requer dos agentes públicos o conhecimento das disposições legais, dos procedimentos, bem como da definição da atuação de cada um dos envolvidos neste procedimento, conforme previamente definido em normativas específicas, a fim de que possam executar suas atividades com segurança;

Com o advento da Lei n.º 14.133/2021, chamada de Nova Lei de Licitações e Contratos (NLLC) prevê, de forma explícita, a necessidade da segregação de funções, bem como estabelece que é dever das altas autoridades adotar as medidas cabíveis para viabilizar essa definição de competências e normatizar a atividade fiscalizatória;

A Lei n.º 14.133/2021 evidência a necessidade de capacitar as equipes e prepará-las para atuar sob as disposições do novo diploma legal. Assim, a atuação na área dos contratos destinados a suprir as demandas relativas às diversas atividades que lhe são inerentes, requererá dos gestores e fiscais o conhecimento da legislação de modo a garantir a eficiência, bem como a segurança jurídica na sua atuação fiscalizatória dos contratos.

Em virtude da necessidade de capacitar a equipe para a excelência do serviço público, e pela necessidade contínua de se adotar as melhores práticas de gestão e inovação, e, assim, qualificar adequadamente o quadro funcional do Conselho Regional de Psicologia da 6ª Região justifica-se a contratação.
